import React, { useState } from "react";
import axios from "axios";
import "./prescriptionform.css";

const PrescriptionForm = () => {
  const [formData, setFormData] = useState({
    doctorName: "",
    specialty: "",
    patientName: "",
    address: "",
    insurance: "",
    diagnosis: "",
    medicines: [
      {
        medicineName: "",
        dosage: "",
        frequency: "",
        quantity: "",
        instructions: ""
      }
    ],
    notes: ""
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleMedicineChange = (e, index) => {
    const { name, value } = e.target;
    const updatedMedicines = [...formData.medicines];
    updatedMedicines[index][name] = value;
    setFormData({ ...formData, medicines: updatedMedicines });
  };

  const handleAddMedicine = () => {
    setFormData({
      ...formData,
      medicines: [
        ...formData.medicines,
        { medicineName: "", dosage: "", frequency: "", quantity: "", instructions: "" }
      ]
    });
  };

  const handleRemoveMedicine = (index) => {
    const updatedMedicines = formData.medicines.filter((_, i) => i !== index);
    setFormData({ ...formData, medicines: updatedMedicines });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    axios
      .post("/api/prescriptions", formData)
      .then((response) => {
        alert("Prescription created successfully!");
        setFormData({
          doctorName: "",
          specialty: "",
          patientName: "",
          address: "",
          insurance: "",
          diagnosis: "",
          medicines: [
            { medicineName: "", dosage: "", frequency: "", quantity: "", instructions: "" }
          ],
          notes: ""
        });
      })
      .catch((error) => console.error("Error creating prescription:", error));
  };

  return (
    <div className="container">
      <div className="prescription-card">
        <div className="header">
          <h2>Create Prescription</h2>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="doctor-info">
            <label>Doctor Name:</label>
            <input
              type="text"
              name="doctorName"
              value={formData.doctorName}
              onChange={handleInputChange}
              required
            />
            <label>Specialty:</label>
            <input
              type="text"
              name="specialty"
              value={formData.specialty}
              onChange={handleInputChange}
              required
            />
          </div>

          <div className="patient-info">
            <label>Patient Name:</label>
            <input
              type="text"
              name="patientName"
              value={formData.patientName}
              onChange={handleInputChange}
              required
            />
            <label>Address:</label>
            <input
              type="text"
              name="address"
              value={formData.address}
              onChange={handleInputChange}
              required
            />
            <label>Insurance:</label>
            <input
              type="text"
              name="insurance"
              value={formData.insurance}
              onChange={handleInputChange}
              required
            />
            <label>Diagnosis:</label>
            <input
              type="text"
              name="diagnosis"
              value={formData.diagnosis}
              onChange={handleInputChange}
              required
            />
          </div>

          <div className="prescription-section">
            <p className="rx">Rx</p>
            {formData.medicines.map((medicine, index) => (
              <div key={index} className="medicine">
                <label>Medicine Name:</label>
                <input
                  type="text"
                  name="medicineName"
                  value={medicine.medicineName}
                  onChange={(e) => handleMedicineChange(e, index)}
                  required
                />
                <label>Dosage:</label>
                <input
                  type="text"
                  name="dosage"
                  value={medicine.dosage}
                  onChange={(e) => handleMedicineChange(e, index)}
                  required
                />
                <label>Frequency:</label>
                <input
                  type="text"
                  name="frequency"
                  value={medicine.frequency}
                  onChange={(e) => handleMedicineChange(e, index)}
                  required
                />
                <label>Quantity:</label>
                <input
                  type="number"
                  name="quantity"
                  value={medicine.quantity}
                  onChange={(e) => handleMedicineChange(e, index)}
                  required
                />
                <label>Instructions:</label>
                <input
                  type="text"
                  name="instructions"
                  value={medicine.instructions}
                  onChange={(e) => handleMedicineChange(e, index)}
                  required
                />
                <button type="button" onClick={() => handleRemoveMedicine(index)}>
                  Remove Medicine
                </button>
              </div>
            ))}
            <button type="button" onClick={handleAddMedicine}>
              Add Medicine
            </button>
          </div>

          <div className="notes-section">
            <label>Notes:</label>
            <textarea
              name="notes"
              value={formData.notes}
              onChange={handleInputChange}
            />
          </div>

          <div className="footer">
            <button type="submit">Create Prescription</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default PrescriptionForm;
